const useStyles = makeStyles(theme => ({
    root: {
        '& > *': {
            margin: theme.spacing(1),
            width: '25ch',
        },
    },
}));

import React, { Component } from 'react'

export class NotesComponent extends Component {
    render() {
        return (
<header>
            <h1>Add note</h1>
            <form className={classes.root}>
                <TextField
                    id="note-name"
                    label="Name"
                    type="text"
                />
                <TextField
                    id="note-content"
                    label="Content"
                    type="text"
                    multiline
                    rowsMax="4"
                />
                <TextField
                    id="datetime-picker"
                    label="Deadline"
                    type="datetime-local"
                    defaultValue="2017-05-24T10:30"
                    className={classes.textField}
                    InputLabelProps={{
                        shrink: true,
                    }}
                />
            </form>

        </header>
        )
    }
}

export default NotesComponent
